PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `exchange_point_m` (
    `exchange_point_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    `name_en` TEXT,
    `small_asset` TEXT NOT NULL,
    `small_asset_en` TEXT,
    `icon_asset` TEXT NOT NULL,
    `icon_asset_en` TEXT,
    `middle_asset` TEXT,
    `middle_asset_en` TEXT,
    `r_rank_up_point` INTEGER,
    `sr_rank_up_point` INTEGER,
    `ssr_rank_up_point` INTEGER,
    `ur_rank_up_point` INTEGER,
    `sort` INTEGER NOT NULL,
    `start_date` TEXT,
    `end_date` TEXT,
    `release_tag` TEXT,
    PRIMARY KEY (`exchange_point_id`)
);
CREATE TABLE `exchange_nopoint_unit_m` (
    `unit_id` INTEGER NOT NULL,
    PRIMARY KEY (`unit_id`)
);
CREATE TABLE `exchange_festival_point_unit_m` (
    `unit_id` INTEGER NOT NULL,
    PRIMARY KEY (`unit_id`)
);
CREATE TABLE `exchange_ticket_m` (
    `exchange_ticket_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    `name_en` TEXT,
    `small_asset` TEXT,
    `small_asset_en` TEXT,
    `middle_asset` TEXT,
    `middle_asset_en` TEXT,
    `large_asset` TEXT,
    `large_asset_en` TEXT,
    `release_tag` TEXT,
    PRIMARY KEY (`exchange_ticket_id`)
);
CREATE TABLE `exchange_ticket_reward_m` (
    `exchange_ticket_reward_id` INTEGER NOT NULL,
    `exchange_ticket_id` INTEGER NOT NULL,
    `group_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` TEXT,
    `comment` TEXT,
    `comment_en` TEXT,
    `release_tag` TEXT,
    PRIMARY KEY (`exchange_ticket_reward_id`)
);
COMMIT;
